import "./style.css";
import { createRoot } from 'react-dom/client';
import homePic from "../img/pic/14k5.jpg";
import locPin from "../img/icons/location.svg";
import secCam from "../img/icons/sec_cam.svg";
import Login from "../login/login.js";


const Main = () => {
    return (  
      <div className="main">
        <div className="main-header-full-size">
          <div className="container">
            <ul className="main-header">
              <li className="main-header__item order2">
                <div className="main-header__item__grid-box">
                <Login />
                  <div className="main-header__item__info">
                    <div className="main-header__item__info__btn">Сдать показания</div>
                    <div className="main-header__item__info__btn">Написать обращение</div>
                    <div className="main-header__item__info__btn">Собрания собственников</div>
                  </div>
                </div>
              </li>
              <li className="main-header__item order"> 
                <div className="main-header__item__container">
                  <div className="main-header__item__container__phone">
                    <div className="main-header__item__container__phone-img">
                    </div>
                    <div className="main-header__item__container__phone-grid">
                      <span>КЛИЕНТСКИЙ ОТДЕЛ</span>
                      <p>+7 (343) 267-96-43</p>
                      <span>ДИСПЕТЧЕРСКАЯ СЛУЖБА</span>
                      <p>+7 (343) 346-81-84</p>
                    </div>
                  </div>
                  <div className="main-header__item__top-white-box d-none-xs"><div></div></div>
                  <img src={homePic} className="main-header__item__pic d-none-xs" tittle="Краснолесья 14к5 картинка" alt="Краснолесья 14к5 вид картинка"/>
                  <div className="main-header__item__bottom-white-box d-none-xs"><div></div></div>
                  <div className="main-header__item__sec-cam d-none-xs" ><img src={secCam} className="main-header__item__sec-cam-img" tittle="Камера охраны" alt="камера охраны картинка"/></div>
                  <a href="#!"><img src={locPin} className="main-header__item__location d-none-xs" tittle="Краснолесья 14к5 на карте" alt="Краснолесья 14к5 вид картинка"/></a>
                </div>
              </li>
            </ul>
          </div>
        </div>
      </div>
    );
  }
  
  export default Main;

  const TextRing = ({children, side}) => {
    const CHARS = children.split('')
    const INNER_ANGLE = 360 / CHARS.length
    return (
      <span
        className="text-ring"
        style={{
          '--total': CHARS.length,
          '--radius': side / Math.sin(INNER_ANGLE / (180 / Math.PI))
        }}
      >
        {CHARS.map((char, index) => (
          <span style={{'--index': index }}>
            {char}
          </span>
        ))}
      </span>
    )
  }
  
  const AppText = () => {
    return (
      <TextRing side={1.6}>
        Видеонаблюдение в доме •&nbsp;
      </TextRing>
    )
  }
  
  createRoot (<AppText/>, document.querySelector('.main-header__item__sec-cam'));
